import './App.css';
import Header from './Components/Header/Header';
import SecondPart from './Components/SecondPart/SecondPart';
import { 
  ApolloClient,
  InMemoryCache,
  HttpLink,
  createHttpLink,
  ApolloProvider,
} from "@apollo/client";
import {setContext} from "@apollo/client/link/context"

//creating the http link (from graphql the link remains same doesnot change according to the endpoints like rest)
const httpLink = createHttpLink({
  uri:"https://api.github.com/graphql",
});

//creating the authlink for authorisation
const authLink = setContext((_, headers) => {
  return {
    headers: {
      ...headers,
      authorization: `Bearer ${process.env.GITHUB_ACCESS_TOKEN}`,
    }
  }
});

//creating the instance of the apolloclient 
const client = new ApolloClient({
  link: authLink.concat(httpLink),
  cache: new InMemoryCache()
})

function App() {
  return (
    <ApolloProvider client={client}>
      <div className="App">  
        <Header />
        <SecondPart />
        <div className="third">hhhhh</div>
    </div>  
    </ApolloProvider>
  );
}

export default App;
